import React from 'react'; // Import the Component component from React

function Slide(props) {
  return(
    <div className="slide row no-gutters" style={{width:"100%"}}>
        <div className="slide-imgWrapper col-lg-6">
          <img className="slide-img" src={props.image} alt="default"/>
        </div>
    </div>
  )
}

export default Slide;
